import React, { useState } from 'react';
import { Tab, Button } from "semantic-ui-react";
import "./Users.scss";
import { BasicModal } from "../../../componentes/Shared/BasicModal";

export function Users() {

  const [showModal, setShowModal] = useState(false);
  
  const panes = [
    {
      menuItem: "Usuários ativos",
      render: () => (
        <Tab.Pane attached={false}>
          <h2>Usuários ativos</h2>
        </Tab.Pane>
      ),
    },
    {
      menuItem: "Usuários inativos",
      render: () => (
        <Tab.Pane attached={false}>
          <h2>Usuários inativos</h2>
        </Tab.Pane>
      ),
    },
  ];

  return (
    <>
      <div className='users-page'>
        <Button className='users-page__add' primary onClick={ () => { console.log("Abrir formulário")}}>
          Novo Usuário
        </Button>
        <Tab menu={{ secondary: true }} panes={panes} />
      </div>

      <BasicModal show={ showModal }>
          
      </BasicModal>
    </>
  );
}
